import React, { Component } from 'react';
import data from "./data"; 
import "../stylesheets/Navigation.css"

var navButtons = document.getElementsByClassName("nav-item nav-link")
for (var i = 0; i < navButtons.length; i++) {
    navButtons[i].addEventListener("click", function() {
        var current = document.getElementsByClassName("active");

        // If there's no active class
        if (current.length > 0) {
          current[0].className = current[0].className.replace(" active", "");
        }
    
        // Add the active class to the current/clicked button
        this.className += " active";
    })
}

class Navigation extends Component {
    render() {
        return (
            <nav class="nav-side-menu">
                <div class="navbar-nav">

                <img src="https://i.ibb.co/VSnBN2v/whale.png" alt="whale" border="0" />

                <a class="nav-item nav-link" href="#">
                    <img src="https://i.ibb.co/p2pMv5r/message.png" alt="messages" border="0" 
                    style={{width: "95%", height: "140%", marginTop:"-7px"}}
                    onMouseOver={e => (e.currentTarget.src = "https://i.ibb.co/znnK2Kh/message-white.png")} 
                    onMouseOut={e => (e.currentTarget.src = "https://i.ibb.co/p2pMv5r/message.png")}/></a>
                <a class="nav-item nav-link" href="#">
                <img src="https://i.ibb.co/48vcwXG/teams.png" alt="teams" border="0" 
                    style={{width: "95%", height: "140%", marginTop:"-8px"}}
                    onMouseOver={e => (e.currentTarget.src = "https://i.ibb.co/LRNPBJJ/teams-white.png")} 
                    onMouseOut={e => (e.currentTarget.src = "https://i.ibb.co/48vcwXG/teams.png")}/></a>
                <a class="nav-item nav-link" href="#">
                <img src="https://i.ibb.co/Pw64dZ7/profile.png" alt="profile" border="0" 
                    style={{width: "95%", height: "125%", marginTop:"-5px"}}
                    onMouseOver={e => (e.currentTarget.src = "https://i.ibb.co/7Swn87s/profile-white.png")} 
                    onFocus={e => (e.currentTarget.src = "https://i.ibb.co/7Swn87s/profile-white.png")}
                    onMouseOut={e => (e.currentTarget.src = "https://i.ibb.co/Pw64dZ7/profile.png")}/></a>
                <a class="nav-item nav-link" href="#">
                <img src="https://i.ibb.co/x7Tgq0q/stats.png" alt="stats" border="0" 
                    style={{width: "95%", height: "135%", marginTop:"-9px"}}
                    onMouseOver={e => (e.currentTarget.src = "https://i.ibb.co/tL90pp4/stats-white.png")} 
                    onMouseOut={e => (e.currentTarget.src = "https://i.ibb.co/x7Tgq0q/stats.png")}/></a>
                <a class="nav-item nav-link" href="#" style={{position: "absolute", bottom: "0"}} >
                    <img src="https://i.ibb.co/T1b2hjK/question.png" alt="help" border="0" 
                    style={{width: "75%", marginLeft: "7px"}}
                    onMouseOver={e => (e.currentTarget.src = "https://i.ibb.co/FDhFWYB/question-white.png")} 
                    onMouseOut={e => (e.currentTarget.src = "https://i.ibb.co/T1b2hjK/question.png")}/></a>
                </div>
            </nav>
        );
    }
}

export default Navigation;
